instructor_example.post:
Instructors affected my learning experience by:

Rushing through material, resulting in me feeling lost, confused, and inept;
Audibly talking to one another about worrying that they were running overtime, undermining confidence in the workshop and instilling a sense of shame in me for not understanding more quickly;
 Acting confused by questions about morals, ethics, and privacy, implicitly dismissing students' concerns about such;
 Repeatedly modifying instructions immediately given with accompanying warnings about how following the instruction incorrectly would result in negative consequences, creating uncertainty and fear about whether an instruction was safe to follow or would harm a student's device
